import React from 'react';

export const BananaIcon: React.FC<React.ImgHTMLAttributes<HTMLImageElement>> = (props) => {
  // --- INSTRUCTIONS ---
  // 1. Go to an online "Image to Base64" converter.
  // 2. Upload your logo image.
  // 3. Copy the generated string (it will start with 'data:image/...;base64,').
  // 4. Paste the entire string below, replacing the placeholder text inside the quotes.
  
  const userImageBase64 = "data:image/png;base64,";
  
  // A simple fallback to the previous icon in case the placeholder isn't replaced.
  const finalImageSrc = userImageBase64.startsWith('data:image') 
    ? userImageBase64 
    : `data:image/svg+xml,<svg viewBox="0 0 24 24" xmlns="http://www.w3.org/2000/svg" fill="%23facc15"><path d="M21.5,8.5c-1.2-0.8-4.7-2.9-7.9-2.9c-4.4,0-6.1,2.3-6.1,2.3S5.8,9,4.8,11.2c-1,2.2,0.1,5.1,0.1,5.1s-1.4-2.8,0.2-5.7 c1.5-2.7,4.4-4.2,6.4-4.2c3.2,0,6.9,2.2,6.9,2.2s1.4,0.9,2,2C21.7,11.8,22.1,9.3,21.5,8.5z" /></svg>`;

  return (
    <img 
      src={finalImageSrc}
      alt="BananaShop logo"
      {...props}
    />
  );
};
